import mongoose from 'mongoose';
const userSchema=new mongoose.Schema({
    name:{
        type:String,
        required:true,
    },
    email:{
        type:String,
        required:true,
        unique:true,
    },
    password:{
        type:String,
        required:true,
    },
    image:{
        type:String,
        default:"data:image/jpeg;base64,"
    },
    address:{
        type:Object,
        default:{line1:'',line2:''},
    },
    gender:{
        type:String,
        default:'Not Selected',
    },
    dob:{
        type:Object,
        default:'Not Selected'
    },
    phone:{
        type:String,
        default:'0000000000'
    }
})
 export const userModel=mongoose.model('secUser',userSchema)